document.addEventListener("DOMContentLoaded",(function(){const e=document.querySelector(".darkmode-enabler");if(e){const r=e.querySelector("input[type=checkbox]"),o=window.matchMedia("(prefers-color-scheme:dark)").matches;window.matchMedia("(prefers-color-scheme: dark)").addEventListener("change",(function(e){console.log("changed!!")})),r.addEventListener("change",(e=>{e.target.checked?document.querySelector("body").classList.add("darkmode-pls"):document.querySelector("body").classList.remove("darkmode-pls")})),o&&(r.checked=!0,document.querySelector("body").classList.add("darkmode-pls"))}})),window.addEventListener("load",(()=>{if("serviceWorker"in navigator)try{navigator.serviceWorker.register("./serviceWorker.js"),console.log("Service Worker Registered")}catch(e){console.log("Service Worker Registration Failed")}}));